function Desk_AppInDay(n,t,i,r){r==Master_branchID&&AjaxLoad(url="/Desk/DeskMaster/?handler=LoadApp",data={AppID:n,DoctorID:t,StatusID:i,BranchID:r},async=!0,error=function(){notiError_SW()},success=function(t){let i=JSON.parse(t);if(i&&i.length==1){let n=i[0];Desk_UpdateRow(n)}else Desk_RemoveRow(n)})}function Desk_UpdateRow(n){let t=n.ID;LoadAppointmentListAjax(t,1)}function Desk_RemoveRow(n){$("#Row_App_Inday_"+n).length>0&&$("#Row_App_Inday_"+n).remove()}function Desk_RoomInDay(n){RealTime_Remove(n.oldroom_id,n.oldchair_id,n.cust_id);n.newroom_id!=0||n.newchair_id!=0?RealTime_Add(n.newroom_id,n.newchair_id,n.cust_id,n.cust_name,n.current_doctor,new Date):RSD_LoadRealtime(n.oldroom_id,n.oldchair_id)}